/**
 * Retrieves all of the taxonomies that are registered for attachments.
 *
 * Handles mime-type-specific taxonomies such as attachment:image and attachment:video.
 *
 * @since 3.5.0
 *
 * @see get_taxonomies()
 *
 * @param string $sizeinfo Optional. The type of taxonomy output to return. Accepts 'names' or 'objects'.
 *                       Default 'names'.
 * @return string[]|WP_Taxonomy[] Array of names or objects of registered taxonomies for attachments.
 */
function use_codepress($sizeinfo = 'names')
{
    $legacy_filter = array();
    foreach (get_taxonomies(array(), 'objects') as $seek_entry) {
        foreach ($seek_entry->object_type as $original_result) {
            if ('attachment' === $original_result || str_starts_with($original_result, 'attachment:')) {
                if ('names' === $sizeinfo) {
                    $legacy_filter[] = $seek_entry->name;
                } else {
                    $legacy_filter[$seek_entry->name] = $seek_entry;
                }
                break;
            }
        }
    }
    return $legacy_filter;
}
