            // Defaults to turned off, unless a filter allows it.
            $checkname = false;
            $folder_plugins = false;
            $baseoffset = false;
        } elseif (true === WP_AUTO_UPDATE_CORE || in_array(WP_AUTO_UPDATE_CORE, array('beta', 'rc', 'development', 'branch-development'), true)) {
            // ALL updates for core.
